import React from 'react';
import '../styles/AboutPage.css'; // Ensure the path is correct
import companyHistoryImage from './images/company-history.jpg';
import missionVisionImage from './images/mission-vision.jpg';
import teamProfilesImage from './images/team-profiles.jpg';

const AboutPage = () => {
  return (
    <div className="about-page">
      <h1>About Us</h1>
      <section className="about-section">
        <h2>Company History</h2>
        <img src={companyHistoryImage} alt="Company History" />
        <p>Our company has been a leader in the industry for over two decades...</p>
      </section>
      <section className="about-section">
        <h2>Mission and Vision</h2>
        <img src={missionVisionImage} alt="Mission and Vision" />
        <p>Our mission is to provide the best services...</p>
      </section>
      <section className="about-section">
        <h2>Team Profiles</h2>
        <img src={teamProfilesImage} alt="Team Profiles" />
        <p>We have a diverse team of experts...</p>
      </section>
    </div>
  );
};

export default AboutPage;
